import React from 'react';
import ProjectsData from './data/projects.json';
import ResponsiveGrid from './components/ResponsiveGrid';
import DataListBlock from './components/DataListBlock';
import Footer from './components/Footer';

const aboutBannerImg = {
    backgroundImage: 'url("/images/hilton.jpg")',
    backgroundPosition: 'center',
    backgroundSize: 'cover',
    height: '30vh',
    margin: '15px 0 0 0',
}

const bannerTxt = {
    color: '#fff',
    margin: '3vw 0 0 0',
    fontFamily: 'arial, san-serif',
    fontSize: '4.5vw',
    fontWeight: '100',
    textAlign: 'left',
}

const textCont1 = {
    background: 'rgba(26,56,111,.5)',
    padding: '6vw 0 20px 6vw',
    flex: '1',

}
const textCont2 = {
    display: 'block',
    background: 'rgba(100,100,100,.5)',
    flex: '1',
}

function Projects() {
    return (
        <div className="content">
            <div className="banner" style={ aboutBannerImg }>
                <div style={ textCont1 }>
                    <h2 style={ bannerTxt }>
                        Our Expertise
                        <br/>
                        <b style={{fontWeight: '600'}}>Speaks</b>
                        <br/>
                        For Itself.
                    </h2>
                </div>
                <div style={ textCont2 }></div>
            </div>

            <ResponsiveGrid jsonData={ ServicesData } />

            <DataListBlock jsonData={ ServicesData } />

            <Footer />

        </div>
    );
}

export default Projects;
